"""## Shell Sort (Ordenación de concha)

### Definición

En **shellSort**, ordenamos la matriz h para un valor grande de h. Seguimos reduciendo el valor de h hasta que se convierte en 1. Se dice que una matriz está ordenada h si todas las sublistas de cada h'ésimo elemento están ordenadas.\

**Programa Python para ShellSort**\
El código Python proporcionado demuestra Shell Sort, una optimización del
algoritmo Insertion Sort. Shell Sort clasifica los elementos en intervalos más grandes inicialmente, reduciendo gradualmente el tamaño del intervalo. El código define la función shellSort que toma una matriz arr como entrada. Inicializa un espacio del tamaño de un espacio como la mitad de la longitud de la matriz. El algoritmo realiza una clasificación de inserción modificada dentro de cada intervalo, reduciendo gradualmente la brecha. Los elementos se comparan y se desplazan a sus posiciones correctas. El código del controlador inicializa una matriz, aplica la función shellSort e imprime tanto la matriz original como la ordenada. La complejidad temporal de este algoritmo depende de la secuencia de espacios elegida, lo que ofrece un rendimiento mejorado con respecto a la clasificación por inserción.


* En el mejor caso: Ω(n log(n))
* En el caso intermedio: Θ((n log(n))^2)
* En pero caso: O((n log(n))^2)

https://www.geeksforgeeks.org/python-program-for-shell-sort/

### Pseudocódigo para ordenación de concha:
"""

'''
Procedimiento shell_sort(arr: Arreglo)
    n = longitud(arr)
    gap = n // 2
    mientras gap > 0 hacer
        para i = gap hasta n hacer
            temp = arr[i]
            j = i
            mientras j >= gap y arr[j - gap] > temp hacer
                arr[j] = arr[j - gap]
                j = j - gap
            fin mientras
            arr[j] = temp
        fin para
        gap = gap // 2
    fin mientras
Fin Procedimiento

'''

"""### Codigo Shell Sort (Ordenación de concha)"""

def shell_sort(arr):
    n = len(arr)
    gap = n // 2
    while gap > 0:
        for i in range(gap, n):
            temp = arr[i]
            j = i
            while j >= gap and arr[j - gap] > temp:
                arr[j] = arr[j - gap]
                j -= gap
            arr[j] = temp
        gap //= 2

# Ejemplo de uso
arr = [random.randint(0, 100) for _ in range(20)]
print("Arreglo antes de ordenar:")
print(arr)

shell_sort(arr)

print("\nArreglo después de ordenar:")
print(arr)

"""## Comb Sort (Ordenación de peine)

### Definición

Comb Sort es principalmente una mejora con respecto a Bubble Sort. La clasificación de burbujas siempre compara valores adyacentes. Entonces todas las inversiones se eliminan una por una. Comb Sort mejora el Bubble Sort al utilizar un espacio de tamaño superior a 1. El espacio comienza con un valor grande y se reduce en un factor de 1,3 en cada iteración hasta que alcanza el valor 1. Por lo tanto, Comb Sort elimina más de una. cuenta con un intercambio y funciona mejor que Bubble Sort.

* En el mejor caso: Ω((n^2)/(2^p)) donde p es el numero de incrementos
* En el caso intermedio: Θ(n log(n))
* En pero caso: O(n^2)

https://www.geeksforgeeks.org/comb-sort/ \
https://en.wikipedia.org/wiki/Comb_sort

### Pseudocódigo para ordenación de peine:
"""

'''Función getNextGap(gap):
    gap = (gap * 10) / 13
    Si gap < 1:
        Devolver 1
    Sino:
        Devolver gap

Función combSort(arr):
    n = longitud(arr)
    brecha = n
    intercambiado = Verdadero
    conteo = 0
    Mientras brecha != 1 o intercambiado sea Verdadero:
        brecha = getNextGap(brecha)
        intercambiado = Falso
        Para i en rango(0, n - brecha):
            conteo += 1
            Si arr[i] > arr[i + brecha]:
                Intercambiar arr[i] y arr[i + brecha]
                intercambiado = Verdadero
                conteo += 1
    Devolver arr, conteo

'''

"""### Codigo Comb Sort (Ordenación de peine)"""

# To find next gap from current
def getNextGap(gap):

    # Shrink gap by Shrink factor
    gap = (gap * 10)//13
    if gap < 1:
        return 1
    return gap

# Función para ordenar arr[] usando Comb Sort y contar operaciones
def combSort(arr):
    n = len(arr)
    # Inicializar brecha
    brecha = n
    # Inicializar intercambiado como Verdadero para asegurarse de que el bucle se ejecute
    intercambiado = True
    # Inicializar variable de conteo para contar operaciones
    conteo = 0
    # Seguir ejecutando mientras la brecha sea mayor que 1 y la última iteración haya causado un intercambio
    while brecha != 1 or intercambiado:
        # Encontrar la siguiente brecha
        brecha = getNextGap(brecha)
        # Inicializar intercambiado como Falso para verificar si ocurrió o no un intercambio
        intercambiado = False
        # Comparar todos los elementos con la brecha actual
        for i in range(0, n - brecha):
            conteo += 1  # Incrementar conteo por comparación
            if arr[i] > arr[i + brecha]:
                arr[i], arr[i + brecha] = arr[i + brecha], arr[i]
                intercambiado = True
                conteo += 1  # Incrementar conteo por intercambio
    return arr, conteo

# Código de prueba para verificar
arr = [8, 4, 1, 56, 3, -44, 23, -6, 28, 0]
arreglo_ordenado, operaciones = combSort(arr.copy())
print("Arreglo ordenado:", arreglo_ordenado)
print("Número de operaciones:", operaciones)

"""## Pigeonhole Sort (Ordenación de agujeros de paloma)

### Definición

Pigeonhole Sort es un algoritmo de clasificación que es adecuado para ordenar listas de elementos donde el número de elementos y el número de valores clave posibles son aproximadamente los mismos. Requiere tiempo O ( n + Rango ), donde n es el número de elementos en la matriz de entrada y 'Rango' es el número de valores posibles en la matriz.
\
\
**Programa Python para ordenar casilleros
Funcionamiento del algoritmo:**

1. Encuentre valores mínimos y máximos en una matriz. Deje que los valores mínimo y máximo sean 'min' y 'max' respectivamente. También busque el rango como 'max-min-1'.
2. Configure una serie de “casilleros” inicialmente vacíos del mismo tamaño que el rango.
3. Visite cada elemento de la matriz y luego coloque cada elemento en su casillero. Se coloca un elemento arr[i] en el agujero en el índice arr[i] – min.
4. Inicie el bucle en toda la matriz de casilleros en orden y coloque los elementos de los huecos no vacíos nuevamente en la matriz original.

https://www.geeksforgeeks.org/python-program-for-pigeonhole-sort/

### Pseudocódigo para ordenación de agujeros de paloma:
"""

'''PigeonholeSort(arr[])
    Encontrar el mínimo y máximo valor en el arreglo y calcular el rango de valores (max_val - min_val + 1)
    Crear un arreglo de "agujeros" del tamaño del rango de valores, inicializado con ceros
    Para cada elemento en el arreglo:
        Incrementar el conteo en el agujero correspondiente al valor del elemento
    Reconstruir el arreglo en orden:
        Inicializar un índice para el arreglo
        Para cada agujero en el rango de valores:
            Mientras el agujero no esté vacío:
                Colocar el valor correspondiente al agujero en la posición actual del arreglo
                Incrementar el índice
                Decrementar el conteo en el agujero
    Devolver el arreglo ordenado
'''

"""### Codigo Pigeonhole Sort (Ordenación de agujeros de paloma)"""

def pigeonhole_sort(arr):
    n = len(arr)
    min_val = min(arr)
    max_val = max(arr)
    range_val = max_val - min_val + 1
    holes = [0] * range_val

    # Llenar los agujeros
    for num in arr:
        holes[num - min_val] += 1

    # Reconstruir el arreglo en orden
    index = 0
    for i in range(range_val):
        while holes[i] > 0:
            arr[index] = i + min_val
            index += 1
            holes[i] -= 1

# Ejemplo de uso
arr = [random.randint(0, 100) for _ in range(20)]
print("Arreglo antes de ordenar:", arr)
pigeonhole_sort(arr)
print("Arreglo después de ordenar:", arr)

"""## Randomized Quick Sort (Ordenación rápida aleatoria)

### Definición

En QuickSort, primero particionamos la matriz en su lugar de modo que todos los elementos a la izquierda del elemento pivote sean más pequeños, mientras que todos los elementos a la derecha del pivote sean mayores que el pivote. Luego llamamos recursivamente al mismo procedimiento para los subarreglos izquierdo y derecho.
A diferencia de merge sort , no necesitamos fusionar las dos matrices ordenadas. Por lo tanto, Quicksort requiere menos espacio auxiliar que Merge Sort, por lo que a menudo se prefiere a Merge Sort. Usando un pivote generado aleatoriamente podemos mejorar aún más la complejidad temporal de QuickSort.

Ejecución manual
Antes de implementar el algoritmo Counting Sort en un lenguaje de programación, ejecutemos manualmente una matriz corta, solo para tener una idea.

Paso 1: comenzamos con un arreglo
```
# myArray = [ 3, 5, 7, 8, 12, 15]
```
Paso 2: Considerando el peor de los casos posibles, si el pivote aleatorio elegido es también el número de índice más alto, compara todos los demás números y se selecciona otro pivote.
```
# myArray = [ 3, 5, 7, 8, 12, *15*]
```
Dado que 15 es mayor que todos los demás números de la lista, no se intercambiará y se elegirá otro pivote.\
Paso 3: Esta vez, si la función de pivote aleatorio elige 7 como número de pivote:
```
# myArray = [ 2, 3, 0, 2, 3, 2]
```
Paso 4: Ahora el pivote divide la lista por la mitad, por lo que normalmente se realiza la clasificación rápida estándar. Sin embargo, la complejidad del tiempo es menor que en el peor de los casos.\
\
Cabe señalar que la complejidad temporal del peor caso de la clasificación rápida siempre seguirá siendo O(n 2 ), pero con la aleatorización estamos disminuyendo las ocurrencias de ese peor caso


* En el mejor caso: Ω(n log(n))
* En pero caso: O(n^2))

https://www.baeldung.com/cs/randomized-quicksort \
https://www.geeksforgeeks.org/quicksort-using-random-pivoting/
https://www.tutorialspoint.com/data_structures_algorithms/dsa_randomized_quick_sort_algorithm.htm

### Pseudocódigo para ordenación rápida aleatoria:
"""

'''Función quick_sort_aleatorio(arr):
    Si longitud de arr es menor o igual a 1:
        Retorna arr  # Ya está ordenado
    Si no:
        pivote = seleccionar_pivote_aleatorio(arr)  # Selecciona un pivote aleatorio del arreglo
        menores, iguales, mayores = partir(arr, pivote)  # Divide el arreglo en tres partes: menores, iguales y mayores que el pivote
        Retorna quick_sort_aleatorio(menores) + iguales + quick_sort_aleatorio(mayores)  # Recursivamente ordena las partes menores y mayores, y concatena los resultados

Función seleccionar_pivote_aleatorio(arr):
    Retorna un elemento aleatorio de arr como pivote

Función partir(arr, pivote):
    menores = []  # Almacena los elementos menores que el pivote
    iguales = []  # Almacena los elementos iguales al pivote
    mayores = []  # Almacena los elementos mayores que el pivote
    Para cada elemento en arr:
        Si elemento es menor que pivote:
            Agrega elemento a menores
        Si elemento es igual a pivote:
            Agrega elemento a iguales
        Si elemento es mayor que pivote:
            Agrega elemento a mayores
    Retorna menores, iguales, mayores
'''

"""### Codigo Randomized Quick Sort (Ordenación rápida aleatoria)"""

import random

def randomized_quick_sort(arr, low, high):
    if low < high:
        pivot = partition(arr, low, high)
        randomized_quick_sort(arr, low, pivot - 1)
        randomized_quick_sort(arr, pivot + 1, high)

def partition(arr, low, high):
    pivot_index = random.randint(low, high)
    pivot = arr[pivot_index]
    swap(arr, pivot_index, high)
    i = low
    for j in range(low, high):
        if arr[j] < pivot:
            swap(arr, i, j)
            i += 1
    swap(arr, i, high)
    return i

def swap(arr, i, j):
    arr[i], arr[j] = arr[j], arr[i]

# Ejemplo de uso
arr = [random.randint(0, 100) for _ in range(20)]
print("Arreglo antes de ordenar:", arr)
randomized_quick_sort(arr, 0, len(arr) - 1)
print("Arreglo después de ordenar:", arr)

